import React from "react";
import Files from './file.json';

const element = <h1>Hello World</h1>

function App() {
return (
	<div className="App">
    {
      Files.map(file => {
        return(
          <div className="box">
            {file.id}
          </div> 
        )
      })
    }
  </div>

  );

}






export default App;
